import React from 'react';
import '../styles/Home.css';


const Home = () => {
  return (
    <div className="home">
      <div className='rectangle-background'>
          <h2>Lucila <br/>y<br/> Luciano</h2>
          <p>Y mis ojos, versus su sonrisa, terminaron por tirar lafachada</p>
      </div>
    </div>
  )
}

export default Home
